import React, { useState, useEffect } from 'react';
import { useModal } from '../services/modalService';
import { notificationService } from '../services/notificationService';
import MultiAuthLogin from './shared/components/MultiAuthLogin'; // Import from client
import NotificationModal from './modals/NotificationModal';
import AccountModal from './modals/AccountModal';

const Icon = {
  Bell: () => (
    <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
      <path d="M15 17h5l-1.4-1.4A2 2 0 0 1 18 14.2V11a6 6 0 1 0-12 0v3.2c0 .5-.2 1-.6 1.4L4 17h5"/>
      <path d="M9 17a3 3 0 0 0 6 0"/>
    </svg>
  ),
  User: () => (
    <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
      <path d="M20 21a8 8 0 1 0-16 0"/>
      <circle cx="12" cy="7" r="4"/>
    </svg>
  )
};

const Header: React.FC = () => {
  const modal = useModal();
  const [unreadCount, setUnreadCount] = useState(0);

  useEffect(() => {
    const unsubscribeNotifications = notificationService.subscribe(() => {
      setUnreadCount(notificationService.getUnreadCount());
    });
    
    setUnreadCount(notificationService.getUnreadCount());

    return () => {
      unsubscribeNotifications();
    };
  }, []);

  // Authentication handlers to match client pattern
  const handleUserChange = (user: any) => {
    console.log('User changed:', user);
  };

  const handleSignIn = (user: any) => {
    console.log('User signed in:', user);
  };

  const handleSignOut = () => {
    console.log('User signed out');
  };

  return (
    <>
      <header className="dashboard-header">
        <div className="dashboard-header__inner">
          {/* Logo - Use the same logo path as client */}
          <div>
            <img 
              src="/assets/whatishealthylogo.png" 
              alt="What is Healthy?" 
              style={{ 
                height: '40px', 
                width: 'auto',
                objectFit: 'contain'
              }}
              onError={(e) => {
                // Fallback to text logo if image fails
                e.currentTarget.style.display = 'none';
                const textLogo = document.createElement('h1');
                textLogo.textContent = 'What is Healthy?';
                textLogo.style.cssText = 'margin: 0; font-size: 24px; font-weight: 600; color: #1f2937;';
                e.currentTarget.parentNode?.appendChild(textLogo);
              }}
            />
          </div>
          
          <div className="header-right">
            {/* Notifications Bell */}
            <button 
              className="header-icon-btn"
              onClick={modal.openNotifications}
              style={{ position: 'relative' }}
            >
              <Icon.Bell />
              {unreadCount > 0 && <span className="badge-dot">{unreadCount}</span>}
            </button>
            
            {/* Use MultiAuthLogin component from client */}
            <MultiAuthLogin 
              position="inline"
              className="header-auth-button"
              onUserChange={handleUserChange}
              onSignIn={handleSignIn}
              onSignOut={handleSignOut}
              style={{
                background: 'transparent',
                border: 'none',
                padding: '8px 12px',
                borderRadius: '8px',
                display: 'flex',
                alignItems: 'center',
                gap: '8px',
                cursor: 'pointer',
                transition: 'background-color 0.2s ease'
              }}
            />
          </div>
        </div>
      </header>

      <NotificationModal 
        isOpen={modal.showNotifications} 
        onClose={modal.closeNotifications} 
      />
      <AccountModal 
        isOpen={modal.showAccount} 
        onClose={modal.closeAccount} 
      />
    </>
  );
};

export default Header;
